import{_ as e,c as t,o,ag as i}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP COLLATION","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_COLLATION.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_COLLATION.md"}'),s={name:"docs/7x/ref_guide/sql_commands/DROP_COLLATION.md"};function n(l,a,d,c,r,p){return o(),t("div",null,a[0]||(a[0]=[i('<h1 id="drop-collation" tabindex="-1">DROP COLLATION <a class="header-anchor" href="#drop-collation" aria-label="Permalink to &quot;DROP COLLATION&quot;">​</a></h1><p>Removes a previously defined collation.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP COLLATION [ IF EXISTS ] &lt;name&gt; [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP COLLATION</code> removes a previously defined collation. To be able to drop a collation, you must own the collation.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p><code>IF EXISTS</code> : Do not throw an error if the collation does not exist. A notice is issued in this case.</p><p>name : The name of the collation. The collation name can be schema-qualified.</p><p><code>CASCADE</code> : Automatically drop objects that depend on the collation, and in turn all objects that depend on those objects.</p><p><code>RESTRICT</code> : Refuse to drop the collation if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To drop the collation named <code>german</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP COLLATION german;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The <code>DROP COLLATION</code> command conforms to the SQL standard, apart from the <code>IF EXISTS</code> option, which is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_COLLATION.html">ALTER COLLATION</a>, <a href="./CREATE_COLLATION.html">CREATE COLLATION</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',19)]))}const u=e(s,[["render",n]]);export{m as __pageData,u as default};
